import warning from 'warning';
export var FiasLogger = function FiasLogger() {};
FiasLogger.warnings = {
  baseUrlOrApiIsRequired: 'property "baseUrl" or "api" is required',
  noBaseUrl: 'baseUrl is not specified',
  fetchError: 'fetch error'
};

